window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"19.1.2","implementation":{"name":"cucumber-jvm","version":"7.8.0"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"17.0.4.1+1"},"os":{"name":"Mac OS X"},"cpu":{"name":"x86_64"}}},{"testRunStarted":{"timestamp":{"seconds":1679775956,"nanos":223325000}}},{"source":{"uri":"classpath:features/RetailAccount.feature","data":"@completeTest\nFeature: Retail Application Account Feature\n\n  Background: \n    Given User is on retail website\n    When User click on Sign in option\n    And User enter email 'test.shaiq@tek.com' and password 'Tek@123456'\n    And User click on login button\n    And User should be logged in into Account\n    When User click on Account option\n\n  Scenario: Verify User can update Profile Information\n    When User click on Account option\n    And User update Name 'transformers' and Phone '1012028855'\n    And User click on Update button\n    Then User profile information should be updated\n\n  @addAddress\n  Scenario: Verify User can add  an Address\n    When User click on Account option\n    And User click on  Add address option\n    And User fill new address form with below information\n      | country | fullName | PhoneNumber | StreetAddress | apt | city | state | zipCode |\n    And User click Add Your Address button\n    Then a message should be displayed 'Address Added Successfully'\n\n  @updatePassword\n  Scenario: Verify User can Update password\n    When User click on Account option\n    And User enter below information\n      | previousPassword | newPassword | confirmPassword |\n      | Tek@123456        | Tek@12345  | Tek@12345      |\n    And User click on Change Password button\n    Then a password message should be displayed 'Password Updated Successfully'\n\n  @addPayment\n  Scenario: Verify User can add a payment method\n    When User click on Account option\n    And User click on Add a payment method link\n    And User fill Debit or credit card information\n      | cardNumber       | nameOnCard   | expirationMonth | expirationYear | securityCode |\n      | 1234106443214321 | Ahmad Dashty |               7 |           2027 |          223 |\n    And User click on Add your card button\n    Then a payment message should be displayed 'Payment Method added sucessfully'\n\n  @editPayment\n  Scenario: Verify User can edit Debit or Credit card\n    When User click on Account option\n    And User click on Edit option of card section\n    And user edit information with below data\n      | editCardNumber   | editNameOnCard | editExpirationMonth | editExpirationYear | editSecurityCode |\n      | 1234567887654355 | Transformers   |                   9 |               2026 |              322 |\n    And user click on Update Your Card button\n    Then a update message should be displayed 'Payment Method updated Successfully'\n\n  @removeCard\n  Scenario: Verify User can remove Debit or Credit card\n    When User click on Account option\n    And User click on remove option of card section\n    Then payment details should be removed\n\n  @updateAddress\n  Scenario: Verify User can edit an Address added on account\n    When User click on Account option\n    And User click on edit address option\n    And user fill new address form with below information\n      | country | fullName  | phoneNumber | streetAddress | apt | city    | state   | zipCode |\n      | Canada  | Ahmad Jan |  1237074422 | 100 14th NW   | A   | NewCity | Alberta |   20002 |\n    And User click update Your Address button\n    Then a address update message should be displayed 'Address Updated Successfully'\n\n  @removeAddress\n  Scenario: Verify User can remove Address from Account\n    When User click on Account option\n    And User click on remove option of Address section\n    Then Address details should be removed\n\n \n   ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailAccount.feature","feature":{"location":{"line":2,"column":1
